import React, { useState, useEffect } from "react";
import axios from "axios";
import "../styles/MainLayout.css";// CSS'yi bu dosyada tutuyoruz

function Home({ userRole }) {
  const [activeTab, setActiveTab] = useState("personel");
  const [accounts, setAccounts] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [selectedAccountId, setSelectedAccountId] = useState(null);
  const [updatedAccount, setUpdatedAccount] = useState({
    title: "",
    username: "",
    password: "",
    notes: "",
  });

  const fetchAccounts = async () => {
    try {
      const response = await axios.get("http://localhost:5059/api/accounts");
      setAccounts(response.data);
    } catch (error) {
      console.error("Veriler alınamadı:", error);
    }
  };

  useEffect(() => {
    fetchAccounts();
  }, []);

  const handleDelete = async (id) => {
    try {
      await axios.delete(`http://localhost:5059/api/accounts/${id}`);
      fetchAccounts();
    } catch (error) {
      console.error("Silme başarısız:", error);
    }
  };

  const handleUpdateClick = (account) => {
    setSelectedAccountId(account.id);
    setUpdatedAccount({
      title: account.title,
      username: account.username,
      password: account.password,
      notes: account.notes,
    });
    setShowModal(true);
  };

  const handleUpdateSave = async () => {
    try {
      await axios.put(`http://localhost:5059/api/accounts/${selectedAccountId}`, updatedAccount);
      setShowModal(false);
      fetchAccounts();
    } catch (error) {
      console.error("Güncelleme başarısız:", error);
    }
  };

  return (
    <div className="home-container">
      <div className="tab-header">
        <button
          className={activeTab === "personel" ? "active" : ""}
          onClick={() => setActiveTab("personel")}
        >
          Personel
        </button>
        <button
          className={activeTab === "paylasilan" ? "active" : ""}
          onClick={() => setActiveTab("paylasilan")}
        >
          Paylaşılanlar
        </button>
      </div>

      <div className="account-list">
        {accounts.map((account) => (
          <div key={account.id} className="account-card">
            <h3>{account.title}</h3>
            <p><strong>Kullanıcı Adı:</strong> {account.username}</p>
            <p><strong>Şifre:</strong> {account.password}</p>
            <p><strong>Not:</strong> {account.notes}</p>
            <div className="button-group">
              <button onClick={() => handleUpdateClick(account)}>Güncelle</button>
              <button onClick={() => handleDelete(account.id)}>Sil</button>
            </div>
          </div>
        ))}
      </div>

      {showModal && (
        <div className="modal-overlay">
          <div className="modal">
            <h2>Hesabı Güncelle</h2>
            <input
              type="text"
              placeholder="Başlık"
              value={updatedAccount.title}
              onChange={(e) =>
                setUpdatedAccount({ ...updatedAccount, title: e.target.value })
              }
            />
            <input
              type="text"
              placeholder="Kullanıcı Adı"
              value={updatedAccount.username}
              onChange={(e) =>
                setUpdatedAccount({ ...updatedAccount, username: e.target.value })
              }
            />
            <input
              type="password"
              placeholder="Şifre"
              value={updatedAccount.password}
              onChange={(e) =>
                setUpdatedAccount({ ...updatedAccount, password: e.target.value })
              }
            />
            <input
              type="text"
              placeholder="Notlar"
              value={updatedAccount.notes}
              onChange={(e) =>
                setUpdatedAccount({ ...updatedAccount, notes: e.target.value })
              }
            />

            <div className="modal-buttons">
              <button className="save-btn" onClick={handleUpdateSave}>Kaydet</button>
              <button className="cancel-btn" onClick={() => setShowModal(false)}>İptal</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Home;
